def this_function(s: str) -> bool:
    if '-' not in s:
        return True
    first_part = s.split('-', 1)[0]
    if not first_part.isdigit():
        return False
    year = int(first_part)
    return 0 <= year <= 2025

def this_function(s: str) -> bool:
    if s.count('-') < 2:
        return True
    parts = s.split('-', 2)
    month_part = parts[1]
    if not month_part.isdigit():
        return False
    month = int(month_part)
    return 1 <= month <= 12

def this_function(s: str) -> bool:
    if s.count('-') < 2:
        return True
    parts = s.split('-', 2)
    day_part = parts[2]
    if not day_part.isdigit():
        return False
    day = int(day_part)
    return 1 <= day <= 31
